import React from 'react';

function PrincipalAside() {
  return (
    <aside>
      <h3>Refine sua busca</h3>
      <h4>Por preço</h4>
      <label htmlFor="prices">
        Até R$40
        <input id="prices" type="checkbox" name="price-search" value="40" />
        R$40 A R$60
        <input id="prices" type="checkbox" name="price-search" value="40" />
        R$100 A R$200
        <input id="prices" type="checkbox" name="price-search" value="40" />
        R$200 A R$500
        <input id="prices" type="checkbox" name="price-search" value="40" />
        Acima de R$500
        <input id="prices" type="checkbox" name="price-search" value="40" />
      </label>
    </aside>
  );
}

export default PrincipalAside;
